import React from "react";
import {Menu} from "semantic-ui-react";



const Filter = ({setFilter, filterBy}) => {
    return(
            <Menu secondary>
                <Menu.Item active={filterBy === 'all'} >Все</Menu.Item>
                <Menu.Item>Цена Дорогие</Menu.Item>
                <Menu.Item>Цена Дешевые</Menu.Item>
                <Menu.Item>По моделям</Menu.Item>
            </Menu>
        )

};
export default Filter
